import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";

import { useState, useEffect } from "react";
import { Routes, Route, Link, useNavigate, Outlet } from "react-router-dom";
import Navbar from "./Navbar";
import HiddenBar from "./HiddenBar";
import CollectionMen from "./CollectionMen";

function App() {
  return (
    <div className="App">
      <div className="space"></div>
      <Navbar />
      <HiddenBar />
      <Routes>
        <Route
          path="/"
          element={
            <div>
              <img
                src="https://www.italianfootwearsolution.com/wp-content/uploads/2021/05/Suede-shoes.jpg"
                className="main-image"
              ></img>
              <Button variant="outline-info" className="more-button">
                View All
              </Button>{" "}
            </div>
          }
        />
        <Route path="/cart" element={<div>cart</div>}></Route>
        <Route path="/collection/men" element={<CollectionMen />}></Route>
      </Routes>
    </div>
  );
}

export default App;
